import React from 'react';
import './styles/global.css';

function App() {
  return (
    <div className="App">
      <Title text="Titulo 1"/>
      <Title text="Titulo 2"/>
      <Title text="Titulo 3"/>
      <Title text="Titulo 4"/>
    </div>
  );
}

export default App;
